static void imodel_init(IMODEL* const _imodel,
						 ADVANSTATE* const _advanstate,
						 const POPPARAM* const _popparam)
{
	const double* _theta = _popparam->theta;
	const double* _eta = _popparam->eta;
	const RECORD* const _record = _advanstate->record;

	/* allow access to RECORD fields */
	const double ID = _record->ID;
	(void)ID;
	const double TIME = _record->TIME;
	(void)TIME;
	const double DV = _record->DV;
	(void)DV;
	const double AMT = _record->AMT;
	(void)AMT;
	const double RATE = _record->RATE;
	(void)RATE;
	const double EVID = _record->EVID;
	(void)EVID;
	const double AGE = _record->AGE;
	(void)AGE;
	const double WT = _record->WT;
	(void)WT;
	const double HT = _record->HT;
	(void)HT;
	const double M1F2 = _record->M1F2;
	(void)M1F2;
	const double A1V2 = _record->A1V2;
	(void)A1V2;

	/* declare and set IMODEL fields */
	double V1 = _imodel->V1;
	double V2 = _imodel->V2;
	double V3 = _imodel->V3;
	double CL = _imodel->CL;
	double Q2 = _imodel->Q2;
	double Q3 = _imodel->Q3;
	double SIZE = _imodel->SIZE;

#define THETA(i) 		((const double)_theta[(i)-1])
#define ETA(i) 		((const double)_eta[(i)-1])
#define A(i) 			((const double)_advanstate->state[(i)-1])
#define INITCOUNT 		pmx_advan_initcount(_advanstate)
#define ALAG(i,t) 		pmx_advan_amtlag(_advanstate, (i)-1, (t))
#define BIOAVAIL(i,f)	pmx_advan_bioavail(_advanstate, (i)-1, (f))
#define STATETIME 		((const double)_advanstate->statetime)
#define INITTIME(t) 	pmx_advan_inittime(_advanstate, (t))
#define A_0(i,v) 		pmx_advan_state_init(_advanstate, (i)-1, (v))

/* begin user code to init the IMODEL */
	SIZE = WT/70.;
	V1 = THETA(1) * SIZE * exp(ETA(1));
	V2 = THETA(2) * SIZE * exp(ETA(2));
	V3 = THETA(3) * SIZE * exp(ETA(3));
	CL = THETA(4) * pow(SIZE, 0.75) * exp(ETA(4));
	Q2 = THETA(5) * pow(SIZE, 0.75) * exp(ETA(5));
	Q3 = THETA(6) * pow(SIZE, 0.75) * exp(ETA(6));
/* end user code to init the IMODEL */

#undef THETA
#undef ETA
#undef STATE
#undef A
#undef ALAG
#undef BIOAVAIL
#undef STATETIME
#undef INITCOUNT
#undef INITTIME
#undef A_0

	/* set IMODEL fields */
	_imodel->V1 = V1;
	_imodel->V2 = V2;
	_imodel->V3 = V3;
	_imodel->CL = CL;
	_imodel->Q2 = Q2;
	_imodel->Q3 = Q3;
	_imodel->SIZE = SIZE;
}

